		this.stop();
		document.addEventListener("keydown", handleKeyDown);
		document.addEventListener("keyup", handleKeyUp);
		stage.enableMouseOver();
		
		var root = this;
		var speed = 100;
		
		function handleKeyDown(event){
			console.log(root.background_mc.x);
			console.log(root.guy_mc.scaleX);
			console.log("background_mc.x = " + root.background_mc.x);
			if (root.guy_mc.currentFrame == 9){
				root.guy_mc.gotoAndPlay("walking");
			}
			if (event.keyCode == 39 && root.background_mc.x > -947.3) {
				root.guy_mc.scaleX = 0.5209;
				root.background_mc.x = root.background_mc.x - speed;
				
			}
			if (event.keyCode == 37 && root.background_mc.x < 2852.7) {
				root.guy_mc.scaleX = -0.5209
				root.background_mc.x = root.background_mc.x + speed;
			}
			
		}
		
		function handleKeyUp(event){
			root.guy_mc.gotoAndPlay("standing");
		}
		
		
		this.background_mc.frog_mc.addEventListener("click",handleClickFrog);
		
